import React, {Component} from 'react';
import 'antd/dist/antd.css';

class Introduce extends React.Component {
    render() {
        return (
            <div className={"Introduce"}>
                <h3>网站介绍</h3>
            </div>

        )
    }
}


export default Introduce;
